import React from 'react';
import './App.css';
import {BrowserRouter as Router, Routes, Route, useNavigate} from 'react-router-dom';
import ScreeningInfoComponent from './ScreeningInfoComponent'; // Import your ScreeningInfoComponent here
import GuestPage from './GuestPage'; // Import your GuestPage component (explained later)

function App() {
    const navigate = useNavigate();
        return (
          <Router>
              <Routes>
                  <Route path="/" element={<App />} /> {/* Route for landing page */}
                  <Route path="/guest" element={<GuestPage />} /> {/* Route for guest page */}
              </Routes>
              <div className="App">
                  <header className="App-header">
                      <h1>Welcome to HRK's Cinema</h1>
                  </header>
                  <main className="landing-page">
                      <div className="login-options">
                          <h2> Login </h2>
                          <div className="login-option">
                              <button className="google-login"> Login with Google</button>
                              <p className="description"> This will allow you to access your booking history and
                                  preferences. </p>
                          </div>
                      </div>
                      <div className="login-option">
                          <button className="guest-login" onClick={() => {
                              navigate('/guest');
                          }}> Continue as guest </button>
                          <p className="description"> No login required. </p>
                      </div>
                      <ScreeningInfoComponent/> {/* Render your ScreeningInfoComponent here */}
                  </main>
              </div>
          </Router>
        );
}

export default App;
